imp

const Dashboard = () => {
    return (
      <div>
        
        <h2 >most popular</h2>
        <div className='games-div'>
            <div className='poker-out-div'>
            <div className='poker-div'>
                <img src={require('../assets/poker.webp')} />
            </div>
            <h3>poker</h3>
            </div>
        </div>
      </div>
    );
  };
  
  export default Dashboard;
